properties.snippet:
#editor_container {
    visibility: hidden;
    z-index:  100;
}

#loading-mask {
  position: absolute;
  left:     0;
  top:      0;
  width:    100%;
  height:   100%;
  z-index:  20000;
  background-color: white;
  opacity:0.6;
  filter:alpha(opacity=60);
}

#loading {
  position: absolute;
  left:     50%;
  top:      50%;
  padding:  2px;
  z-index:  20001;
  height:   auto;
  margin:   -35px 0 0 -30px;
}

#loading .loading-indicator {
  background: url(^Extras("wobject/Survey/rel_interstitial_loading.gif");) no-repeat;
  color:      #555;
  font:       bold 13px tahoma,arial,helvetica;
  padding:    18px 80px;
  margin:     0;
  text-align: center;
  height:     auto;
  z-index:  20002;
}


div.testarea {
    width: 200px;
    height: 100px;
    z-index: 999;
    border: 1px solid gray;
    background: #f7f7f7;
    position: absolute;
    top: 5%;
    left:5%;
}

div.trashcan { 
    border: 1px solid gray;
    width: 175px; 
    height: 50px; 
}

div.editarea { 
	margin-top:40px;
    padding:10px; 
    float:left;
    border: 1px solid gray;
}

div.editquestion { 
	padding:10px; 
	float:left; 
}
div.editanswer { 
	padding:10px; 
	float:left; 
}

#submitbutton { padding:20px; }

div.entry { 
    padding-bottom:10px;
    padding-left:10px;
}

ul.draglist { 
    list-style: none;
    margin:0;
    padding:0;
}

ul.draglist li {
    margin: 1px;
}

ul.questionList {
    position: relative;
    background: #f7f7f7;
    border: 1px solid gray;
    list-style: none;
    margin:0;
    padding:0;
    min-height: 40px
}

li.section {
    background-color: #CCCCFF;
    border:1px solid #7EA6B2;
    cursor: move; 
    min-height: 10px;
}
li.question {
    background-color: #D1E6EC;
    border:1px solid #7EA6B2;
    cursor: move; 
	padding-left:10px; 
    min-height: 10px;
}
li.answer {
    background-color: #F1FFB8;
    border:1px solid #7EA6B2;
    cursor: move; 
	padding-left:15px; 
    min-height: 10px;
}
#sections-panel li.selected {
    background-image: url(^Extras("toolbar/bullet/moveRight.gif"););
    background-position:99% center;
    background-repeat: no-repeat;
    font-weight:bold;
}

#goto-yui-ac {
    width:15em;
    margin-top:0.5em;
}
.wGwarning {
    background-color:#FF6666;
    border:1px solid red;
    margin:5px;
    padding:10px;
}
.warning {
    padding: 5px;
}
#sections-panel .bd {
    overflow: auto;
    background-color:#fff;
    padding:10px;
}
#buttons {
    height: 30px; 
}
#sections-panel_c .yui-resize .yui-resize-handle-r {
    right: -6px; /* make room for the scroll-bars */
}
#sections-panel div.ft {
    font-size: 100%;
}
